import React from 'react';
import {Carousel} from '3d-react-carousal';

function testimonial() {
    let slides = [
        <img  src="https://picsum.photos/800/300/?random" alt="1"  style={{width:"auto",}}/>,
          ];
    return (
        <div>
            


<Carousel slides={slides} autoplay={true} interval={2000} style={{width:'30rem'}}/>
            
        </div>
    );
}

export default testimonial;
